import React from 'react';

export class  Label{
    render(){
        return(
            <>
            <Headline />
            </>
        );
    }
}
 
export function Headline() {
  const greeting = 'Hello Function Component!';
 
  return <h1>{greeting}</h1>;
}
 
export default Label;
